                                <td>{room.length}</td>
                                <td>{room.width}</td>
                                <td>{room.height}</td>
                                {/* <td>{this.removeUnit}</td> */}


                            </tr>
                        })}
                    </tbody>
                </table><br/>
                    {/* <button className="button" onClick={this.removeUnit}>Remove</button><br/> */}
                <button onClick={this.next} className="Done">Done</button>
            </div>
        )
    }
}
